import React from 'react';
import '../../App.css';
import './Intro.css'; // Custom styles for the Intro component

export default function Intro() {
  return (
    <div className='intro'>
      <h1 className='services'>RÓLAM</h1>
      <div className='intro__content'>
        <img 
          src='/images/me.png' 
          alt='Your Name' 
          className='intro__photo' 
        />
        <div className='intro__text'>
          <p>Üdvözlöm! Háromgyermekes, otthon maradó anyuka vagyok, aki autodidakta módon tanulta meg az alapvető HTML, CSS, JavaScript és React használatát. Jelenleg kezdő szinten vagyok, és napi 4 órában tudok dolgozni. Van közgazdaságtudományi egyetemi diplomám, amit a Corvinus Egyetemen szereztem.</p>
        </div>
      </div>
    </div>
  );
}
